import { SCREENS } from '../hooks/use-screen-media-query.hook.js';
var MQ = {
  sm: "@media (min-width: ".concat(SCREENS.sm, "px)"),
  md: "@media (min-width: ".concat(SCREENS.md, "px)"),
  lg: "@media (min-width: ".concat(SCREENS.lg, "px)"),
  xl: "@media (min-width: ".concat(SCREENS.xl, "px)"),
  xxl: "@media (min-width: ".concat(SCREENS.xxl, "px)"),
  xxxl: "@media (min-width: ".concat(SCREENS.xxxl, "px)")
};
export { MQ };
